    value: With respect to the aggregate overage reported for Edmund Carpenter on
      Line 11a, a refund of the $1100.00 overage was issued on September 9, 2008.  The
      transfer reported on Line 22 for Schedule B was for cash flow purposes.  With
      respect to the Partys expenditures for payroll, payroll taxes and other payroll
      or employee benefit-related expenses, the Party adheres to 11 CFR 300.33, and
      also follows the Commissions revision of the rules as adopted on December 1,
      2005.  Specifically, the Party pays for these costs with 100% federal funds
      when the employee spends more than 25 percent of his or her time in a month
      on federal election activity (FEA) or activity in connection with a federal
      election.  These expenditures are reported on Schedule B for Line 30b.  Alternatively,
      when an employee does not meet the 25 percent threshold, the Party allocates
      these costs as an overhead/administrative expense, and reports these disbursements
      on a Schedule H4 for Line 21a.
